Our culture is defined largely by our values, which we wanted to be constantly reminded of so we asked our friends @_concept_ink to literally print them on our walls: 

1/ Get Shit Done:
We complete our tasks and don't drop the ball. Persevere through the hard work and support the team. 

2/ Push Your Limits: 
Growth occurs beyond the comfort zone. We believe in personal and professional evolution. 

3/ Evolve on Demand:
The goal is to pivot quickly and be a fast running gazelle. Take on challenges that meet our clients' and team's needs. 

4/ No Ego - Idea Meritocracy: 
Ideas are shared freely, no matter the seniority. The best idea always wins. 

5/ Pursuit of Excellence:
The goal is to be streamlined and a thought leader in the industry. We check our work and be our best self. 

What are other ways design can embody culture? 🚀

